import styled from "@emotion/styled";

export const HeaderTopLeft = styled.div`
position: relative;
width: ${ (props) => props.w + "px" };
height: ${ (props) => props.h + "px" };
display: flex;
align-items: center;
justify-content: space-between;
`;
